INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 283, 120701, 0, 1, 0, 0, "【物理】前衛で、雪花舞う晴れ空をゆく新春氷竜少女。\nＵＢで顕現させる氷竜の牙で味方への強化スキルを高め\n自身の範囲攻撃技と共に苛烈な攻勢で敵陣を凍滅する。", "シェフィ（ニューイヤー）", 0, 0, 4, 120701, 1, 120701, 120701, 1.84, "2024/01/31 11:59:59", 22, "2024/01/26 12:00:00", "しぇふぃ", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 193, 120801, 0, 2, 0, 0, "【物理】前衛で雪月花の舞を納める新春の姉御。\n攻撃を当てる度に増加する【剣の刻印】でＵＢとスキルの\n威力を上昇させ、目にも止まらぬ斬撃で敵を圧倒する。", "ルカ（ニューイヤー）", 0, 0, 4, 120801, 1, 120801, 120801, 1.3, "2030/12/31 15:00:00", 22, "2023/10/16 15:00:00", "るか", 1, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 424, 120901, 0, 12, 0, 0, "【魔法】中衛で自らの血を代償に力を振るう新春吸血鬼。\n自身のＨＰを消費して放つ強力なスキルと、敵からＴＰを\n吸収するスキルを自在に操り、目の前の敵を撃滅する。", "イリヤ（ニューイヤー）", 0, 0, 3, 120901, 2, 120901, 120901, 1.425, "2024/01/31 11:59:59", 38, "2024/01/26 12:00:00", "いりや", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 164, 121001, 0, 1, 0, 0, "【物理】前衛で、仲間との絆を力に変え戦う腹ペコ王女。\n敵のＨＰ状態で永続の物理攻撃力上昇と、短時間の特大\n攻撃力上昇＆自己ＴＰ回復を使い分け戦況を一変させる。", "ペコリーヌ（オーバーロード）", 0, 0, 5, 121001, 1, 121001, 121001, 2.25, "2024/02/29 11:59:59", 41, "2024/02/22 12:00:00", "ぺこりーぬ", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 588, 121101, 0, 1, 0, 0, "【魔法】中衛で仲間との絆を力に変え戦うツンデレ猫娘。\n敵を妨害するスキルと、ＵＢで敵全体を恐慌状態にし既に\n恐慌状態の敵のＴＰをダウンさせ、全戦場を掌握する。", "キャル（オーバーロード）", 0, 0, 7, 121101, 2, 121101, 121101, 2.07, "2024/02/29 11:59:59", 42, "2024/02/22 12:00:00", "きゃる", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 260, 121201, 0, 6, 0, 0, "【物理】前衛で世界の理をすべて見つめる『迷宮女王』。\n味方を攻撃面で強化し、継続ＨＰ回復を全体に付与する\nスキルで戦線を整え、自身も圧倒的な力で敵を殲滅する。", "ラビリスタ（オーバーロード）", 0, 0, 4, 121201, 1, 121201, 121201, 1.55, "2030/12/31 15:00:00", 40, "2023/11/16 15:00:00", "らびりすた", 1, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 731, 121301, 0, 3, 0, 0, "【物理】後衛で、皆のため意を決し奮起する小さな女優。\n残りＨＰが多いほど物理攻撃力がアップし、物理攻撃無効\nバリアのスキルやＨＰ・ＴＰ継続回復で味方を支援する。", "クルミ（ステージ）", 0, 0, 3, 121301, 1, 121301, 121301, 1.9, "2030/12/31 15:00:00", 3, "2022/03/03 19:00:00", "くるみ", 3, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 742, 121401, 0, 15, 0, 0, "【魔法】後衛で後ろの味方を強化する魔法少女の看板娘。\n後衛の味方をバリアとＴＰ継続回復で支援し、自分の魔法\n攻撃力に応じ強化される攻撃力アップスキルで鼓舞する。", "ミサキ（ステージ）", 0, 0, 7, 121401, 2, 121401, 121401, 2.27, "2030/12/31 15:00:00", 7, "2022/03/15 15:00:00", "みさき", 3, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 590, 121501, 0, 12, 0, 0, "【物理】中衛で、闇夜に身を潜める神出鬼没の怪盗少女。\n敵の目の前から姿を消す隠密スキルや、遠くの敵に対する\nＴＰダウンスキルを駆使して、敵陣後方から瓦解させる。", "アユミ（怪盗）", 0, 0, 6, 121501, 1, 121501, 121501, 2.0, "2024/04/15 14:59:59", 6, "2024/04/12 12:00:00", "あゆみ", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 292, 121601, 0, 17, 0, 0, "【物理】前衛で闇に紛れ会心の一撃を放つ怪盗ドラゴン。\n隠密効果中、ダメージが大アップし必ずクリティカルする\nＵＢとスキルを駆使し安定したダメージを敵に叩き込む。", "イノリ（怪盗）", 0, 0, 3, 121601, 1, 121601, 121601, 1.425, "2030/12/31 15:00:00", 3, "2022/04/15 15:00:00", "いのり", 3, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 1, 421, 121701, 0, 0, 0, 0, "", "アキノ（アキノ＆サレン）", 180901, 0, 0, 0, 0, 121701, 0, 0.0, "2030/12/31 15:00:00", 0, "2015/04/01 15:00:00", "あきの", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 1, 421, 121801, 0, 0, 0, 0, "", "サレン（アキノ＆サレン）", 180901, 0, 0, 0, 0, 121801, 0, 0.0, "2030/12/31 15:00:00", 0, "2015/04/01 15:00:00", "されん", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 293, 121901, 0, 12, 0, 0, "【魔法】前衛で己を鼓舞し高めた魔力を放つ蒼海の冥姫。\n発動の度、攻撃力とクリティカル時ダメージが上昇する\nＵＢと自己犠牲を払う強力な範囲攻撃技で敵を撃滅する。", "アンナ（パイレーツ）", 0, 0, 5, 121901, 2, 121901, 121901, 2.125, "2030/12/31 15:00:00", 5, "2022/05/15 15:00:00", "あんな", 3, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 380, 122001, 0, 14, 0, 0, "【物理】中衛で、彷徨える魂を解き放つ海星の霊能少女。\n攻撃の際、付与する【霊錨の刻印】を駆使し、ダメージ量\nアップのスキルと防御力ダウンのＵＢで敵を浄滅へ導く。", "シノブ（パイレーツ）", 0, 0, 3, 122001, 1, 122001, 122001, 1.425, "2030/12/31 15:00:00", 3, "2022/05/03 19:00:00", "しのぶ", 3, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 731, 122101, 0, 9, 0, 0, "【物理】後衛で百千の矢を放つ、ぼっちの山籠りエルフ。\n物理魔法無効バリアで耐え凌ぎ、敵全体への射撃と自分の\n間合いに入った敵への強力な弓雨の追撃で掃討する。", "アオイ（キャンプ）", 0, 0, 35, 122101, 1, 122101, 122101, 1.97, "2030/12/31 15:00:00", 35, "2024/04/18 15:00:00", "あおい", 1, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 419, 122201, 0, 8, 0, 0, "【物理】中衛で最高の一杯を自然と共に愉しむ元聖騎士。\n【至福のひと時】が増えるほどに、味方の物理攻撃力や\nクリティカル時のダメージを強力に強化し、勝利を掴む。", "ユカリ（キャンプ）", 0, 0, 4, 122201, 1, 122201, 122201, 1.84, "2030/12/31 15:00:00", 4, "2022/05/31 12:00:00", "ゆかり", 3, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 564, 122301, 0, 0, 0, 0, "【魔法】中衛で、幼き竜と共に歩むさいきょーの吸血姫。\n味方全体の強化と、敵のＴＰを吸収するスキルで力を蓄え\nＵＢ発動後ベスと共闘し防御ダウンと強撃で攻勢に出る。", "ヴァンピィ", 0, 0, 43, 122301, 2, 122301, 122301, 1.425, "2030/12/31 15:00:00", 43, "2022/06/15 15:00:00", "うぁんぴぃ", 3, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 264, 122401, 0, 8, 0, 0, "【物理】前衛で皆にエールを送り鼓舞する真夏の元気娘。\n味方のＨＰを継続回復し行動速度アップの他、味方の数に\n応じてクリティカル強化と攻撃力を引き上げ勝利に導く。", "ヒヨリ（サマー）", 0, 0, 1, 122401, 1, 122401, 122401, 2.42, "2030/12/31 15:00:00", 1, "2024/06/17 15:00:00", "ひより", 1, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 250, 122501, 0, 0, 0, 0, "【物理】前衛で水刃の加護を纏い水面を駆ける渚の剣士。\nクリティカル時のダメージを底上げしＵＢ発動の度、纏う\n【水刃の加護】で全スキルダメージを上げ、敵陣を穿つ。", "レイ（サマー）", 0, 0, 4, 122501, 1, 122501, 122501, 1.965, "2023/07/15 14:59:59", 4, "2023/07/12 12:00:00", "れい", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 554, 122601, 0, 0, 0, 0, "【魔法】中衛で、魔法キャラを補助する夜凪の魔法士。\n累積する攻撃強化スキルとＴＰ回復、物魔両面の無効\nバリアや継続ＨＰ回復で攻守共に味方を支え勝利へ導く。", "ユイ（サマー）", 0, 0, 7, 122601, 2, 122601, 122601, 2.27, "2030/12/31 15:00:00", 7, "2022/07/15 15:00:00", "ゆい", 3, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 812, 122701, 0, 0, 0, 0, "【魔法】後衛で、難しい魔法の練習に励む海辺の優等生。\nランダムな敵に当たるスキルの威力は攻撃の際に付与する\n【バタフライシール】で増幅し、防御力もダウンさせる。", "キョウカ（サマー）", 0, 0, 7, 122701, 2, 122701, 122701, 1.92, "2030/12/31 15:00:00", 7, "2022/08/15 15:00:00", "きょうか", 3, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 237, 122801, 0, 0, 0, 0, "【物理】前衛で敵後方に花火を仕掛ける夜涼みの悪戯娘。\n敵の最前衛をスタンで足止めしつつ、最後衛を中心とした\nＵＢで狭範囲の敵を引き寄せ、ＴＰダウンで攻勢を阻む。", "ミソギ（サマー）", 0, 0, 1, 122801, 1, 122801, 122801, 2.295, "2030/12/31 15:00:00", 1, "2024/07/16 15:00:00", "みそぎ", 1, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 361, 122901, 0, 0, 0, 0, "【物理】中衛で巨大バルーンと跳ね回る夏色うさぎっこ。\nＵＢやスキルで全てのマルチターゲットに追加ダメージを\n与え、自己強化と防御力ダウンで強敵のブレイクを狙う。", "ミミ（サマー）", 0, 0, 5, 122901, 1, 122901, 122901, 2.25, "2023/08/12 11:59:59", 5, "2023/08/09 12:00:00", "みみ", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 746, 123001, 0, 0, 0, 0, "【魔法】後衛で、新たな姿で騎士の冒険を支える妖精。\nダメージカットや防御力アップ、無効バリアで味方を護り\nバリアを起点とする攻撃力とＴＰの支援で攻勢に転ずる。", "アメス", 0, 0, 44, 123001, 2, 123001, 123001, 2.27, "2024/07/03 18:59:59", 44, "2024/06/30 12:00:00", "あめす", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 793, 123101, 0, 0, 0, 0, "【魔法】後衛でぬいぐるみ達と大冒険に挑むマホ隊員。\n味方に付与する【ふわふわウール】は被ダメージ時に消費\nされＴＰを回復し、一気呵成の反撃で活路を切り拓く。", "マホ（エクスプローラー）", 0, 0, 7, 123101, 2, 123101, 123101, 1.795, "2030/12/31 15:00:00", 7, "2022/09/03 19:00:00", "まほ", 3, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 256, 123201, 0, 0, 0, 0, "【物理】前衛で、相棒と困難を越え猛進するアヤネ隊員。\n群る敵を二つの範囲攻撃で一気に捉え、周囲の味方の物理\n攻撃力とクリティカルアップで冒険を阻む壁を打ち崩す。", "アヤネ（エクスプローラー）", 0, 0, 3, 123201, 1, 123201, 123201, 1.425, "2030/12/31 15:00:00", 3, "2022/09/15 15:00:00", "あやね", 3, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 350, 123301, 0, 0, 0, 0, "【物理】中衛で粘液を振りまくキイロいスライムギャル。\nスキルで敵全体の物理攻撃能力やＴＰ上昇を低下させ、\nＵＢでスライム化し全敵を攻撃しつつ無敵ボディを得る。", "ネア", 0, 0, 1, 123301, 1, 123301, 123301, 1.62, "2023/09/15 14:59:59", 0, "2023/09/12 12:00:00", "ねあ", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 123401, 0, 0, 0, 0, "", "ジュン（キャンプ）", 0, 0, 5, 0, 0, 123401, 0, 0.0, "2030/12/31 15:00:00", 5, "2015/04/01 15:00:00", "じゅん", 3, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 1, 583, 123501, 0, 0, 0, 0, "【物理】中衛で敵を悪戯で翻弄する恐怖のキョンシー娘。\n最も魔法攻撃力が高い敵に急襲を仕掛け、ＴＰ減少や魔法\n攻撃力ダウン、スタン等の妨害スキルで機先を制する。", "リン（ハロウィン）", 0, 0, 6, 123501, 1, 123501, 123501, 2.34, "2030/12/31 15:00:00", 6, "2022/09/30 12:00:00", "りん", 1, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 262, 123601, 0, 0, 0, 0, "【物理】前衛で、同志と力を合わせ共に戦う夜廻り剣士。\n自分と物理攻撃力が最も高い味方１キャラの攻撃力を大幅\nに上昇させ、目にもとまらぬ剣技で不届き者を成敗する。", "トモ（ハロウィン）", 0, 0, 4, 123601, 1, 123601, 123601, 1.965, "2023/10/15 14:59:59", 4, "2023/10/10 12:00:00", "とも", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 741, 123701, 0, 0, 0, 0, "【魔法】後衛で、オタ活に精を出すハロウィン魔法少女。\nＨＰ回復量ダウンで敵の戦略を崩し、ダメージフィールド\nと対象の数で火傷の威力を増す熱狂の炎が敵を包み込む。", "ナナカ（ハロウィン）", 0, 0, 7, 123701, 2, 123701, 123701, 2.07, "2030/12/31 15:00:00", 21, "2022/10/15 15:00:00", "ななか", 3, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 238, 123801, 0, 0, 0, 0, "【物理】前衛で、戦場を跳ね回るラビット姿の誓約女君。\n物理攻撃を全て回避するスキルと攻撃力の強化で敵陣に\n単身特攻をかけ、ＵＢの範囲攻撃で敵を内から薙ぎ倒す。", "クリスティーナ（ワイルド）", 0, 0, 1, 123801, 1, 123801, 123801, 2.295, "2023/11/15 14:59:59", 1, "2023/11/10 12:00:00", "くりすてぃーな", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 183, 123901, 0, 0, 0, 0, "【物理】前衛で母製の鎧を纏い気合い上々の獣人族騎士。\n自分のＨＰが低いほど与えるダメージと無効バリアの耐久\n力を高め、防御力ダウンと永続攻撃アップで活路を拓く。", "マツリ（ワイルド）", 0, 0, 2, 123901, 1, 123901, 123901, 2.125, "2030/12/31 15:00:00", 2, "2022/11/15 15:00:00", "まつり", 3, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 438, 124001, 0, 0, 0, 0, "【魔法】中衛で、聖夜の街に幸せを運ぶ双子の妹サンタ。\n自分の魔法攻撃力に応じて効果が上がる味方全体への攻撃\n力強化に加え、単体特大魔法攻撃で勝利の旋律を奏でる。", "アカリ（クリスマス）", 0, 0, 7, 124001, 2, 124001, 124001, 2.07, "2023/12/15 14:59:59", 7, "2023/12/11 12:00:00", "あかり", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 1, 433, 124101, 0, 0, 0, 0, "【魔法】中衛で、光を灯し幸せを届ける双子の姉サンタ。\n最も近い１キャラの魔法攻撃力や行動速度アップ、ＴＰの\n回復に加え、全員を支援するスキルで聖夜の勝利を飾る。", "ヨリ（クリスマス）", 0, 0, 6, 124101, 2, 124101, 124101, 1.965, "2030/12/31 15:00:00", 6, "2022/11/30 12:00:00", "より", 1, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 144, 124201, 0, 0, 0, 0, "【物理】前衛で、味方を庇護し祝福する聖白の騎士団長。\nスキルで後方の味方の攻撃能力を強化、ＴＰを回復させ、\n防御力ダウンと自分のＨＰを回復するＵＢで勝機を掴む。", "ジュン（クリスマス）", 0, 0, 5, 124201, 1, 124201, 124201, 2.07, "2030/12/31 15:00:00", 5, "2022/12/23 12:00:00", "じゅん", 3, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 1, 577, 124301, 0, 0, 0, 0, "", "アン（アン＆グレア）", 181001, 0, 0, 0, 0, 124301, 0, 0.0, "2030/12/31 15:00:00", 0, "2015/04/01 15:00:00", "あん", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 1, 577, 124401, 0, 0, 0, 0, "", "グレア（アン＆グレア）", 181001, 0, 0, 0, 0, 124401, 0, 0.0, "2030/12/31 15:00:00", 0, "2015/04/01 15:00:00", "ぐれあ", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 707, 124501, 0, 0, 0, 0, "【魔法】後衛で、魔力を笑顔に隠す晴れ着姿の龍の首魁。\n自分の攻撃強化とＴＰ回復をし、ＵＢで放つ曙光の落涙は\n敵数で威力と防御力の減少量を上げ、全ての災厄を祓う。", "ホマレ（ニューイヤー）", 0, 0, 7, 124501, 2, 124501, 124501, 2.07, "2024/01/15 14:59:59", 21, "2024/01/12 12:00:00", "ほまれ", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 698, 124601, 0, 0, 0, 0, "【魔法】後衛で真心重ねて味方をもてなす仲居姿の先生。\n全スキルで味方の物理攻撃力とクリティカル能力を上げ、\n魔防やＴＰ上昇の支援とＨＰ、ＴＰの回復で万福を願う。", "ミサト（ニューイヤー）", 0, 0, 7, 124601, 2, 124601, 124601, 2.44, "2024/01/15 14:59:59", 21, "2024/01/12 12:00:00", "みさと", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 1, 590, 124701, 0, 0, 0, 0, "【物理】中衛で、振袖姿で旅館に手を貸す隻眼の闇医者。\n朧ろ状態にした敵への攻撃時、スキルのダメージや防御力\nのダウン値が上昇し、紫煙に捉えた敵を艶然と討ち取る。", "ミツキ（ニューイヤー）", 0, 0, 7, 124701, 1, 124701, 124701, 2.24, "2030/12/31 15:00:00", 46, "2022/12/31 12:00:00", "みつき", 1, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 423, 124801, 0, 0, 0, 0, "【物理】中衛で、未来を信じ希望を灯すトップアイドル。\nバトル開始時に物理キャラのＴＰ特大回復と敵の永続物防\nダウンで加勢し、物理攻撃強化とＴＰ回復で勝利へ導く。", "ノゾミ（リベレイター）", 0, 0, 4, 124801, 1, 124801, 124801, 2.14, "2024/02/14 23:59:59", 0, "2024/02/12 12:00:00", "のぞみ", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 1, 170, 124901, 0, 0, 0, 0, "【物理】前衛で先陣を切り未来を掴む喧嘩屋ドラゴン族。\n初弾が大幅強化するスキルで自分の攻撃力とＴＰを大きく\n高め、威力を増したＵＢで先制し群がる敵を薙ぎ払う。", "カヤ（リベレイター）", 0, 0, 1, 124901, 1, 124901, 124901, 1.965, "2030/12/31 15:00:00", 0, "2023/01/31 12:00:00", "かや", 1, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 221, 125001, 0, 0, 0, 0, "【物理】前衛で、相棒と共に明日へと進む大悪党の少女。\n自己強化や物防ダウンを駆使するムイミと、ＵＢ後に一定\n時間共闘するオクトーの追撃で、輝く未来を取り戻す。", "ムイミ（リベレイター）", 0, 0, 5, 125001, 1, 125001, 125001, 1.965, "2024/02/14 23:59:59", 0, "2024/02/12 12:00:00", "むいみ", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 825, 125101, 0, 0, 0, 0, "【物理】後衛から客を癒しもてなす猫カフェ店員の猫娘。\n物攻の高いキャラの傍で周囲の物攻アップやＨＰとＴＰを\n回復し、周囲の味方数で強化される攻撃で敵を一掃する。", "タマキ（カフェ）", 0, 0, 8, 125101, 1, 125101, 125101, 2.24, "2030/12/31 15:00:00", 47, "2023/03/03 19:00:00", "たまき", 3, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 463, 125201, 0, 0, 0, 0, "【物理】中衛で、駄菓子を振舞い福を蒔く猫カフェ店員。\n攻撃を３回受けるまで味方全体の物理攻撃力を極大アップ\nさせ、２種の物防ダウンスキルで序盤を一気に加勢する。", "モニカ（カフェ）", 0, 0, 4, 125201, 1, 125201, 125201, 1.965, "2030/12/31 15:00:00", 4, "2023/03/10 12:00:00", "もにか", 3, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 752, 125301, 0, 0, 0, 0, "【物理】後衛で、わんわんと一緒の新緑レンジャー少女。\n自分の攻撃力に応じて強化される物理攻撃支援スキルや\nＨＰ継続回復、バリアで周囲を支え、絆の勝利へと導く。", "コッコロ（レンジャー）", 0, 0, 6, 125301, 1, 125301, 125301, 2.07, "2024/04/15 14:59:59", 6, "2024/04/12 12:00:00", "こっころ", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 710, 125401, 0, 0, 0, 0, "【物理】後衛で、相棒と共に山を駆ける新米レンジャー。\nスキルで自分の攻撃力とクリティカル時のダメージを上げ\nＴＰを回復し、ダメージと防御力ダウンで敵を追い込む。", "シオリ（レンジャー）", 0, 0, 8, 125401, 1, 125401, 125401, 2.09, "2030/12/31 15:00:00", 8, "2023/04/10 12:00:00", "しおり", 3, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 443, 125501, 0, 0, 0, 0, "【魔法】中衛で、他の術者と魔力を束ねる究竟の魔導士。\n味方への魔法攻撃支援とＴＰ回復に加え、敵陣の攻防両面\nの弱体化で戦況を整え、自らも強力な攻撃魔法を放つ。", "ジータ（ウォーロック）", 0, 0, 7, 125501, 2, 125501, 125501, 1.92, "2024/05/15 14:59:59", 50, "2024/05/10 12:00:00", "じーた", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 267, 125601, 0, 0, 0, 0, "【物理】前衛で夢と希望とネズ耳を届ける鼠神宮の巫女。\n周囲の味方の物理攻撃支援、ＴＰ上昇アップと回復で援護\nし、自身の無敵化で敵の隙を突き鋭い金牙の一撃を放つ。", "ビカラ", 0, 0, 51, 125601, 1, 125601, 125601, 2.09, "2024/05/15 14:59:59", 0, "2024/05/10 12:00:00", "びから", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 1, 579, 125701, 0, 0, 0, 0, "【魔法】中衛で森羅万象を究め味方を支援する錬金術師。\n物理、魔法の属性を問わない敵の弱体化と味方の強化に加\nえ、スキルによる高頻度のＨＰ回復で盤石な戦局を築く。", "カリン（アルケミスト）", 0, 0, 7, 125701, 2, 125701, 125701, 2.24, "2030/12/31 15:00:00", 9, "2023/04/30 12:00:00", "かりん", 1, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 464, 125801, 0, 0, 0, 0, "【物理】中衛で、黒羽の力を使い空を制する嘆鎌の少女。\nバトル開始時に、敵の範囲攻撃を躱す【飛行】状態となり\n生成したシャドウと共に、眼前の敵を一薙ぎに斬り払う。", "リリ（フォールン）", 0, 0, 3, 125801, 1, 125801, 125801, 2.09, "2030/12/31 15:00:00", 0, "2023/04/17 12:00:00", "りり", 3, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 125901, 0, 0, 0, 0, "", "カヤ（リベレイター）", 0, 0, 1, 0, 0, 125901, 0, 0.0, "2030/12/31 15:00:00", 1, "2015/04/01 15:00:00", "かや", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 406, 126001, 0, 0, 0, 0, "【物理】中衛から、我が身を盾に味方を守る隠棘の少女。\nバトル開始時【飛行】し、最もＨＰの低い味方をかばい、\n味方のＨＰに応じて強化されるスキルで敵を牽制する。", "クリア（フォールン）", 0, 0, 0, 126001, 1, 126001, 126001, 2.09, "2030/12/31 15:00:00", 0, "2023/10/31 12:00:00", "くりあ", 3, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 480, 126101, 0, 0, 0, 0, "【魔法】中衛で、マイペースに味方を支える破杖の少女。\n【飛行】し、クリティカルの強化やＨＰ・ＴＰ回復で味方\nを支援し、魔法攻撃力を加えた物理攻撃で敵を平らげる。", "プレシア（フォールン）", 0, 0, 44, 126101, 2, 126101, 126101, 2.09, "2030/12/31 15:00:00", 53, "2023/11/15 15:00:00", "ぷれしあ", 3, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 568, 126201, 0, 0, 0, 0, "【魔法】中衛で、眷属と永久の血盟を誓う月下の吸血鬼。\nＵＢで眷属を２体喚び、味方への攻撃支援や行動速度上昇\nで強化し、眷属と共に見舞う猛攻で前途を阻む敵を討つ。", "イリヤ（儀装束）", 0, 0, 3, 126201, 2, 126201, 126201, 2.09, "2024/06/15 14:59:59", 3, "2024/06/10 12:00:00", "いりや", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 456, 126301, 0, 0, 0, 0, "【魔法】中衛で、闇色の儀装束を纏う「美を統べる者」。\nステータスアップ効果を受け【美貌】を増し、魔法攻撃力\nダウンや味方の強化、ＴＰ回復の効果を高めて解き放つ。", "ユキ（儀装束）", 0, 0, 7, 126301, 2, 126301, 126301, 2.07, "2030/12/31 15:00:00", 9, "2023/06/15 15:00:00", "ゆき", 3, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 373, 126401, 0, 0, 0, 0, "【物理】中衛で着脱可能な鉄腕を放つ機械人族のロボ娘。\nＵＢ発動で【フルチャージ】状態になり、【バッテリー】\nが切れるまで強化スキルを連発し、一帯を超速圧砕する。", "クローチェ", 0, 0, 1, 126401, 1, 126401, 126401, 2.09, "2024/07/03 18:59:59", 1, "2024/06/30 12:00:00", "くろーちぇ", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 740, 126501, 0, 0, 0, 0, "【魔法】後衛で優美にほほ笑むジオ・テオゴニアの姫君。\n開始時に発動する【界雷】で、敵味方に影響を与えつつ、\n魔法防御ダウンと強力なダメージスキルで裁きを下す。", "ライラエル", 0, 0, 7, 126501, 2, 126501, 126501, 1.965, "2024/07/03 18:59:59", 0, "2024/06/30 12:00:00", "らいらえる", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 650, 126601, 0, 0, 0, 0, "【魔法】後衛で、涼しげに微笑む夏色姿の『変貌大妃』。\nスキルで味方を大幅に強化し、最も魔法攻撃力が高い味方\nの魔法攻撃力を写し取った攻撃力で、強力なＵＢを放つ。", "ネネカ（サマー）", 0, 0, 7, 126601, 2, 126601, 126601, 2.04, "2024/07/15 14:59:59", 7, "2024/07/11 12:00:00", "ねねか", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 1, 224, 126701, 0, 0, 0, 0, "【物理】前衛で、優雅なバカンスを過ごす夕映えの令嬢。\n敵が魔法攻撃をする場合に効果を大幅に上げる２種の範囲\n攻撃と攻防両面の支援スキルで、盛夏の勝鬨を上げる。", "アキノ（サマー）", 0, 0, 5, 126701, 1, 126701, 126701, 1.965, "2030/12/31 15:00:00", 5, "2023/06/30 12:00:00", "あきの", 1, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 159, 126801, 0, 0, 0, 0, "【物理】前衛で、夏の麦しゅわを嗜むビーチの元聖騎士。\n敵単体にダメージを与えながら、周囲の味方への魔法無効\nバリア付与と魔防アップで守りを固めて勝利の波に乗る。", "ユカリ（サマー）", 0, 0, 5, 126801, 1, 126801, 126801, 1.97, "2030/12/31 15:00:00", 5, "2023/07/15 15:00:00", "ゆかり", 3, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 682, 126901, 0, 0, 0, 0, "【魔法】後衛で、密やかな潮騒に耳を傾ける晩陽の歌姫。\n魔法クリティカルの極大アップを筆頭に攻防両面で周囲の\n味方を強化し、さらに自身もＵＢで数多の敵を退かせる。", "ランファ（サマー）", 0, 0, 7, 126901, 2, 126901, 126901, 1.965, "2024/08/12 11:59:59", 21, "2024/08/09 12:00:00", "らんふぁ", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 1, 133, 127001, 0, 0, 0, 0, "【物理】前衛で新たな刺激を追い求める水着姿のドＭ娘。\n自分のＨＰが下がるほど効果量が上昇するスキルの物理攻\n撃力アップとＵＢのダメージで、勝利の大海へ飛び込む。", "クウカ（サマー）", 0, 0, 2, 127001, 1, 127001, 127001, 1.97, "2023/08/14 20:59:59", 52, "2023/07/31 12:00:00", "くうか", 1, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 255, 127101, 0, 0, 0, 0, "【物理】前衛で、穏やかな水面に揺蕩う夜光の霊能少女。\n召喚した親父に敵の攻撃を引き付けさせつつ、シノブ自身\nの攻撃性能強化と防御ダウンを扱い、敵を冥海へと誘う。", "シノブ（サマー）", 0, 0, 5, 127101, 1, 127101, 127101, 2.09, "2024/08/12 11:59:59", 46, "2024/08/09 12:00:00", "しのぶ", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 804, 127201, 0, 0, 0, 0, "【魔法】後衛で、制服姿に胸を高鳴らせるアオハル猫娘。\n攻防両面のサポートに加え行動速度アップとＴＰ回復で味\n方を支援し、最も遠くの敵を狙うＵＢで輝く勝利を得る。", "キャル（編入生）", 0, 0, 7, 127201, 2, 127201, 127201, 2.09, "2024/03/31 11:59:59", 7, "2024/03/28 12:00:00", "きゃる", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 750, 127301, 0, 0, 0, 0, "【物理】後衛でもにカワ制服を着こなすカリスマモデル。\nクリティカル時に味方を強化するスキルや、追加ダメージ\nが発生するＵＢによって青春の一ページを切り取る。", "スズナ（編入生）", 0, 0, 8, 127301, 1, 127301, 127301, 2.09, "2030/12/31 15:00:00", 8, "2023/09/15 15:00:00", "すずな", 3, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 127401, 0, 0, 0, 0, "", "ビカラ（コラボ）", 0, 0, 1, 0, 0, 127401, 0, 0.0, "2030/12/31 15:00:00", 1, "2015/04/01 15:00:00", "びから", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 304, 127501, 0, 0, 0, 0, "【物理】中衛で、優艶に炎と踊り舞う情熱のサレンママ。\n物理攻撃から味方を守り、【炎舞の刻印】の数に応じて効\n果の上がる物攻アップとＴＰ回復で皆を奮い立たせる。", "サレン（サラサリア）", 0, 0, 4, 127501, 1, 127501, 127501, 2.09, "2024/04/30 11:59:59", 4, "2024/04/26 12:00:00", "されん", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 157, 127601, 0, 0, 0, 0, "【物理】前衛で、空飛ぶ絨毯で巡り回るオアシスの姉御。\n自分の物防を大幅に高めて敵を挑発するスキルと敵のＴＰ\nとＴＰ上昇をダウンさせるＵＢで、爽やかに勝利を掴む。", "ルカ（サラサリア）", 0, 0, 4, 127601, 1, 127601, 127601, 1.965, "2030/12/31 15:00:00", 4, "2023/10/15 15:00:00", "るか", 3, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 372, 127901, 0, 0, 0, 0, "【魔法】中衛でみんなに笑顔を届ける腹ペコサンタ王女。\n前線で敵の攻撃を耐えながら範囲内の味方の防御サポート\nと敵の防御ダウンまでこなし、聖夜に勝利の輝きを灯す。", "ペコリーヌ（クリスマス）", 0, 0, 5, 127901, 2, 127901, 127901, 1.965, "2024/05/31 11:59:59", 5, "2024/05/27 12:00:00", "ぺこりーぬ", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 723, 128001, 0, 0, 0, 0, "【物理】後衛で、甘美なひと時を堪能する聖夜の女商人。\n最も遠い味方へのＴＰ回復や、初弾に追加効果のある攻撃\nで敵の弱体化と味方の強化を行い、勝利の舞台を整える。", "クレジッタ（クリスマス）", 0, 0, 35, 128001, 1, 128001, 128001, 2.09, "2030/12/31 15:00:00", 35, "2023/12/15 15:00:00", "くれじった", 3, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 1, 580, 128101, 0, 0, 0, 0, "", "シズル（シズル&リノ）", 181101, 0, 0, 0, 0, 128101, 0, 0.0, "2030/12/31 15:00:00", 0, "2015/04/01 15:00:00", "しずる", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 1, 580, 128201, 0, 0, 0, 0, "", "リノ（シズル&リノ）", 181101, 0, 0, 0, 0, 128201, 0, 0.0, "2030/12/31 15:00:00", 0, "2015/04/01 15:00:00", "りの", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 1, 191, 128301, 0, 0, 0, 0, "【物理】前衛で相手をからかうお調子者の年神ドラゴン。\n敵全体を挑発し、敵の妨害スキルにカウンターして前方の\n敵すべてをスタンさせるスキルで戦局を引っ掻き回す。", "イノリ（ニューイヤー）", 0, 0, 3, 128301, 1, 128301, 128301, 2.09, "2030/12/31 15:00:00", 38, "2023/12/31 12:00:00", "いのり", 1, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 801, 128401, 0, 0, 0, 0, "【魔法】後衛で特別な景色を共にする初夢超能力ガール。\n敵が物理攻撃を行う場合、攻撃性能の強化に加えて複数の\n弱体効果が追加され、攻守ともに味方を支援し敵を掃う。", "ハツネ（ニューイヤー）", 0, 0, 7, 128401, 2, 128401, 128401, 2.09, "2024/06/30 11:59:59", 21, "2024/06/26 12:00:00", "はつね", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 739, 128501, 0, 0, 0, 0, "【魔法】後衛で、絵馬に秘めた願いを祷る新年の名探偵。\n敵と味方の数で効果量が上昇するダメージと攻撃力支援に\n加え、２種類の回復スキルを使いこなして勝利を願う。", "カスミ（ニューイヤー）", 0, 0, 7, 128501, 2, 128501, 128501, 2.09, "2024/06/30 11:59:59", 21, "2024/06/26 12:00:00", "かすみ", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 128601, 0, 0, 0, 0, "", "リリ（フォールン）", 0, 0, 1, 0, 0, 128601, 0, 0.0, "2030/12/31 15:00:00", 1, "2015/04/01 15:00:00", "りり", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 226, 128701, 0, 0, 0, 0, "【物理】前衛で、煌炎宿し希望を振りまく覚醒の元気娘。\n放つ炎は敵を攻守ともに弱化させて同時に味方を鼓舞し、\n２種のＴＰ回復効果で攻勢を絶やさず勝利を呼び込む。", "ヒヨリ（アストラル）", 0, 0, 1, 128701, 1, 128701, 128701, 2.09, "2024/08/15 14:59:59", 0, "2024/08/12 12:00:00", "ひより", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 1, 194, 128801, 0, 0, 0, 0, "【物理】前衛で、旋風を纏い未来へ駆ける覚醒の剣士。\n目にも止まらぬ速さの剣技で敵を吹き飛ばしスタンさせ、\n仲間の守りを固めるスキルを駆使し勝利の道を切り開く。", "レイ（アストラル）", 0, 0, 4, 128801, 1, 128801, 128801, 1.965, "2030/12/31 15:00:00", 0, "2024/01/31 12:00:00", "れい", 1, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 772, 128901, 0, 0, 0, 0, "【魔法】後衛で、願いを力に極光を放つ覚醒の魔法士。\n自分を強化しながら高火力魔法を絶えず撃ち込み、バリア\nを起点とした味方への攻撃支援スキルで勝利を手にする。", "ユイ（アストラル）", 0, 0, 7, 128901, 2, 128901, 128901, 2.09, "2024/08/15 14:59:59", 0, "2024/08/12 12:00:00", "ゆい", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 800, 129001, 0, 0, 0, 0, "【魔法】後衛で、眠りから目覚め美しく咲き誇る黒薔薇。\n終焉を超えし【回帰の薔薇】と、行動速度アップを始めと\nした多種の攻防支援で味方を強化し、新たな未来を掴む。", "エリス", 0, 0, 7, 129001, 2, 129001, 129001, 2.09, "2024/07/03 18:59:59", 0, "2024/06/30 12:00:00", "えりす", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 708, 129301, 0, 0, 0, 0, "【物理】後衛で、退廃的な冬の学びに溺れる水際の才媛。\n物理攻撃の強化、回復、行動速度アップで味方を支援し、\nＵＢで得た【水際の安寧】を死守するため膂力を振るう。", "ユニ（ウィンター）", 0, 0, 7, 129301, 1, 129301, 129301, 2.09, "2024/03/11 11:59:59", 7, "2024/03/03 19:00:00", "ゆに", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 188, 129401, 0, 0, 0, 0, "【物理】前衛で、水面に映る神速のダウナー系水着女子。\n攻撃を当てる度に敵に付与する【水月】の数に応じて物防\nダウンやダメージの効果が上昇し、必勝の抜き手を切る。", "クロエ（ウィンター）", 0, 0, 2, 129401, 1, 129401, 129401, 2.09, "2030/12/31 15:00:00", 2, "2024/03/18 12:00:00", "くろえ", 3, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 550, 129601, 0, 0, 0, 0, "【物理】中衛で怜悧麗花の陣を張るアルラウネの妖魔人。\n敵の攻撃力、防御力、与ダメージを下げ、ＴＰを吸収し、\nＵＢの継続ダメージで領域を侵す敵を絶えず拒み退ける。", "アネモネ", 0, 0, 0, 129601, 1, 129601, 129601, 2.09, "2024/07/03 18:59:59", 0, "2024/06/30 12:00:00", "あねもね", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 540, 129701, 0, 0, 0, 0, "【物理】中衛で万魔の頂点に君臨するジオ・ゲヘナの媛。\n環境効果【妨魔塵】で魔法攻撃を阻害し、行動速度アップ\n等の支援や苛烈な攻撃で無謀な不届き者を平伏させる。", "ネフィ＝ネラ", 0, 0, 0, 129701, 1, 129701, 129701, 2.09, "2024/07/03 18:59:59", 0, "2024/06/30 12:00:00", "ねふぃーねら", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 269, 129801, 0, 0, 0, 0, "【物理】前衛で、情と熱意で仲間を束ねる指揮官の狼娘。\n敵の攻守を削りつつ、自分のＴＰ回復や対象が物防ダウン\n状態の時に発生する追撃で猛攻を仕掛け前線を突破する。", "マコト（コマンダー）", 0, 0, 5, 129801, 1, 129801, 129801, 2.09, "2024/04/12 11:59:59", 5, "2024/03/31 12:00:00", "まこと", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 294, 129901, 0, 0, 0, 0, "【物理】前衛で、苛烈な教えで味方を率いる狂恋の教官。\nＴＰ回復や防御支援に加え味方の人数で効果アップする攻\n撃支援と大ダメージで、味方全体を奮い立たせ敵を破る。", "エリコ（コマンダー）", 0, 0, 6, 129901, 1, 129901, 129901, 1.84, "2030/12/31 15:00:00", 48, "2024/04/15 15:00:00", "えりこ", 3, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 130601, 0, 0, 0, 0, "", "レイ（アストラル）", 0, 0, 4, 0, 0, 130601, 0, 0.0, "2030/12/31 15:00:00", 1, "2015/04/01 15:00:00", "れい", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 563, 130701, 0, 0, 0, 0, "【魔法】中衛で、お花畑に春を届ける花衣装の優等生。\nスキル発動回数に応じた効率的な自己強化やクリティカル\n時の追加効果を持つスキルとＵＢで勝利の風を吹かせる。", "キョウカ（スプリング）", 0, 0, 7, 130701, 2, 130701, 130701, 1.92, "2024/05/15 14:59:59", 7, "2024/05/03 19:00:00", "きょうか", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 558, 130801, 0, 0, 0, 0, "【魔法】中衛で、春に彩られた花衣装のドジっ娘メイド。\n範囲内の敵にダメージを与えながら、多数の弱体化効果を\n持つスキルやＵＢを駆使して、穏やかに吹く勝利を掴む。", "スズメ（スプリング）", 0, 0, 7, 130801, 2, 130801, 130801, 1.84, "2030/12/31 15:00:00", 7, "2024/05/15 15:00:00", "すずめ", 3, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 440, 130901, 0, 0, 0, 0, "【魔法】中衛で、皆を夢の世界に誘う宝石兎族の支配人。\nステータスアップ効果を受けるたびに【かばばん君】を増\nやし、反射的に味方へ攻撃支援の恩返しをしてしまう。", "クルル", 0, 0, 7, 130901, 2, 130901, 130901, 2.09, "2030/12/31 15:00:00", 7, "2024/06/15 15:00:00", "くるる", 3, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 702, 131001, 0, 0, 0, 0, "【魔法】後衛で、サーカスの舞台に輝くメルヘン少女。\n味方の攻防支援や敵の攻防弱体化の他【カーテンコール】\n付与時の追加ダメージスキルで、勝利のライトを照らす。", "マホ（ドリームパーク）", 0, 0, 7, 131001, 2, 131001, 131001, 1.84, "2024/06/10 11:59:59", 7, "2024/05/31 12:00:00", "まほ", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 165, 131101, 0, 0, 0, 0, "【物理】前衛でハグの機会を窺う水着のスライムギャル。\n攻撃してきた敵に【ネバネバ】を自動で付着させ、攻撃力\nダウンやダメージ、束縛など複数の効果を引き起こす。", "ネア（サマー）", 0, 0, 2, 131101, 1, 131101, 131101, 2.09, "2030/12/31 15:00:00", 52, "2024/06/30 12:00:00", "ねあ", 3, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 753, 131201, 0, 0, 0, 0, "【魔法】後衛で夏の盛りにイイコトをする溌溂水着少女★\n【PSI★ストーム】をチャージし、連続攻撃で敵を殲滅し\nて、継続ＴＰ回復やバリアで抜け目なく味方を支援する。", "ミソラ（サマー）", 0, 0, 35, 131201, 2, 131201, 131201, 2.09, "2024/07/15 15:00:00", 35, "2024/07/03 19:00:00", "みそら", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 1, 0, 131301, 0, 0, 0, 0, "", "リリ", 0, 0, 1, 0, 0, 131301, 0, 0.0, "2030/12/31 15:00:00", 1, "2015/04/01 15:00:00", "りり", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 1, 0, 131401, 0, 0, 0, 0, "", "クリア", 0, 0, 1, 0, 0, 131401, 0, 0.0, "2030/12/31 15:00:00", 1, "2015/04/01 15:00:00", "くりあ", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 1, 0, 131501, 0, 0, 0, 0, "", "プレシア", 0, 0, 1, 0, 0, 131501, 0, 0.0, "2030/12/31 15:00:00", 1, "2015/04/01 15:00:00", "ぷれしあ", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 399, 131601, 0, 0, 0, 0, "【物理】中衛で、夏の陽光のもと研鑽する妹系大和撫子。\n防御力アップに加えバリアやＨＰ回復で味方の守りを固め\nＴＰ回復や攻撃力ダウンをも巧みに操り、場を支配する。", "リリ（サマー）", 0, 0, 4, 131601, 1, 131601, 131601, 1.92, "2024/07/26 11:59:59", 4, "2024/07/15 15:00:00", "りり", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 743, 131701, 0, 0, 0, 0, "【魔法】後衛で、黄昏の水面に舞い降りる水着姿の妖精。\n行動速度アップやＴＰ支援をはじめとした多数のサポート\nを施しつつ、ＵＢの攻防弱体化で清爽に勝利へと導く。", "アメス（サマー）", 0, 0, 44, 131701, 2, 131701, 131701, 1.92, "2024/08/12 11:59:59", 53, "2024/07/31 12:00:00", "あめす", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 245, 170101, 0, 4, 0, 0, "【物理】前衛で、先手必勝の大技を繰り出す騎空士。\nスキルによるＴＰ回復は、ユニオンバーストの発動を早め\nバトルの序盤から敵前衛に大ダメージを与える。", "ジータ", 0, 0, 34, 170101, 1, 170101, 105701, 1.965, "2030/12/31 15:00:00", 34, "2015/04/01 15:00:00", "じーた", 3, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 199, 180101, 0, 7, 0, 0, "【物理】前衛で炎翼を背に敵を粉砕する、陽気な元気娘。\n戦いが続く程に自身の攻撃能力を強めるスキルを操り、\n高めた力で放つ超爆の一撃は、あらゆる敵を塵と化す。", "ヒヨリ（プリンセス）", 0, 0, 0, 180101, 1, 180101, 180101, 1.62, "2024/07/03 18:59:59", 0, "2024/06/30 12:00:00", "ひより", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 767, 180201, 0, 1, 0, 0, "【魔法】後衛から極大魔法で敵を滅する願いの魔法士。\nＴＰを回復しつつ攻撃力を累積アップする補助スキルで\n自身の力を高め、強力な範囲攻撃を放ち敵を一掃する。", "ユイ（プリンセス）", 0, 0, 0, 180201, 2, 180201, 180201, 1.92, "2024/07/03 18:59:59", 0, "2024/06/30 12:00:00", "ゆい", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 377, 180301, 0, 7, 0, 0, "【物理】中衛で風刃を従え激戦を流麗に征く嵐翼の剣士。\n敵が多い程に効果が高まる自己強化スキルで、自身を奮い\n立たせ、強力な範囲攻撃スキルで一切の敵を鏖滅する。", "レイ（プリンセス）", 0, 0, 0, 180301, 1, 180301, 180301, 1.965, "2024/07/03 18:59:59", 0, "2024/06/30 12:00:00", "れい", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 155, 180401, 0, 1, 0, 0, "【物理】前衛で、攻防共に絶大な力を誇る腹ペコ王女。\nＨＰが多い時は爆発的な攻撃力で、いかなる敵をも屠り、\nＨＰが減ると自己回復能力を得て、鉄壁の護りを見せる。", "ペコリーヌ（プリンセス）", 0, 0, 0, 180401, 1, 180401, 180401, 1.965, "2024/07/03 18:59:59", 0, "2024/06/30 12:00:00", "ぺこりーぬ", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 555, 180501, 0, 1, 0, 0, "【物理】中衛で、絶大な補助スキルを繰出す純白の巫女。\n味方の攻撃力とクリティカルダメージを強化しつつ、\n二つの全体回復スキルで味方を堅固に守護し勝利へ導く。", "コッコロ（プリンセス）", 0, 0, 0, 180501, 1, 180501, 180501, 2.14, "2024/07/03 18:59:59", 0, "2024/06/30 12:00:00", "こっころ", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 747, 180601, 0, 1, 0, 0, "【魔法】後衛で、極大魔法を操り敵を討つ姫装の猫娘。\n回復や補助を兼ねた各攻撃スキルを駆使し戦況を整え、\n極大威力のユニオンバーストを撃ち込み敵を燼滅する。", "キャル（プリンセス）", 0, 0, 0, 180601, 2, 180601, 180601, 1.92, "2024/07/03 18:59:59", 0, "2024/06/30 12:00:00", "きゃる", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 732, 180701, 0, 1, 0, 0, "【物理】後衛から、真の絆の力を発揮する仲良し姉妹。\n敵の数が増えるほど威力が高まる攻撃スキルと、周りの\n味方を強化するスキルを操り、立ち塞がる敵を一掃する。", "ハツネ＆シオリ", 0, 0, 0, 180701, 1, 180701, 180701, 1.75, "2024/07/03 18:59:59", 0, "2024/06/30 12:00:00", "はつねしおり", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 465, 180801, 0, 1, 0, 0, "【物理】中衛で敵単体に必殺の一撃を放つ仲良しトリオ。\n３人の力を合わせて放つ攻撃は、相手の弱点に合わせて\n物理から魔法攻撃に変化し、どんな強い敵も退治する！", "ミソギ＆ミミ＆キョウカ", 0, 0, 0, 180801, 1, 180801, 180801, 1.5, "2024/07/03 18:59:59", 0, "2024/06/30 12:00:00", "みそぎみみきょうか", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 421, 180901, 0, 1, 0, 0, "【物理】中衛で背を預けあう最高の好敵手で親友の二人。\n味方の物理攻撃をサポートしつつＨＰとＴＰを継続回復し\nＨＰが多いほど威力が増すＵＢで、共に勝利の道を征く。", "アキノ＆サレン", 0, 0, 0, 180901, 1, 180901, 180901, 2.09, "2024/07/03 18:59:59", 0, "2024/06/30 12:00:00", "あきのされん", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 577, 181001, 0, 1, 0, 0, "【魔法】中衛で、魔力共鳴し連撃を放つマナリアの双姫。\nステータスアップ効果を受けると増加する【友情の魔印】\nがスキルを強化し、波長を合わせた炎の魔槍で敵を討つ。", "アン＆グレア", 0, 0, 0, 181001, 2, 181001, 181001, 2.09, "2024/07/03 18:59:59", 0, "2024/06/30 12:00:00", "あんぐれあ", 3, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (450, 0, 551, 181101, 0, 1, 0, 0, "【物理】中衛でお揃い衣装の、真偽を超えた仲良し姉妹。\n攻守共に味方を支えるシズルと、クリティカル時に強力な\nダメージを与えるリノ、姉妹の絆で困難を跳ね除ける！", "シズル＆リノ", 0, 0, 0, 181101, 1, 181101, 181101, 1.92, "2024/07/03 18:59:59", 0, "2024/06/30 12:00:00", "しずるりの", 3, 1);
